float F(float x, float y, float size,int position, uint[6] letter) {

    x-=size*float(position)*0.855;

    if (x<0.0) return 0.;
    if (y<0.0) return 0.;

    uint ux=uint(x*14.0*1.0/size);
    uint uy=uint(y*14.0*1.0/size)+1u;

    if ( uy >= 17u) {
        return 0.;
    }
    if ( ux >= 10u) {
        return 0.;
    }

    uy=16u-uy;
    uint lp = uy / 3u;
    uint lpx = uy % 3u;
    uint packedValue = letter[lp];
    uint row_value = (packedValue >> (lpx * 10u)) & 0x3FFu;

    uint draw=row_value & (1u << (9u - ux));
    return draw==0u?0.0:1.0;
}


